// client/src/components/ViewAirplanes.jsx
import React, { useState, useEffect } from 'react';
import axios from 'axios';

export default function ViewAirplanes() {
  const [airplanes, setAirplanes] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    // fetch once on component mount
    axios.get('/api/airplanes')
      .then(res => setAirplanes(res.data))
      .catch(err => setError(err.response?.data?.error || 'Failed to load'));
  }, []);

  return (
    <div>
      <h2>All Airplanes</h2>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      <table border="1" cellPadding="5">
        <thead>
          <tr>
            <th>AirlineID</th>
            <th>Tail Num</th>
            <th>Seat Cap</th>
            <th>Speed</th>
            <th>LocationID</th>
            <th>Plane Type</th>
            <th>Maintenanced</th>
            <th>Model</th>
            <th>Neo</th>
          </tr>
        </thead>
        <tbody>
          {airplanes.map((ap, i) => (
            <tr key={i}>
              <td>{ap.airlineID}</td>
              <td>{ap.tail_num}</td>
              <td>{ap.seat_capacity}</td>
              <td>{ap.speed}</td>
              <td>{ap.locationID}</td>
              <td>{ap.plane_type}</td>
              <td>{ap.maintenanced?.toString()}</td>
              <td>{ap.model}</td>
              <td>{ap.neo?.toString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
